import React, { useState, useEffect, useRef } from 'react';

const NeuralChatLanding = () => {
  const [currentPhrase, setCurrentPhrase] = useState(0);
  const [currentChar, setCurrentChar] = useState(0);
  const [isDeleting, setIsDeleting] = useState(false);
  const [typingText, setTypingText] = useState('');
  const [visibleSections, setVisibleSections] = useState(new Set());
  const [countersAnimated, setCountersAnimated] = useState(false);
  const observerRef = useRef(null);

  const phrases = [
    "Write code in any language",
    "Generate creative content", 
    "Solve complex problems",
    "Analyze data insights",
    "Create marketing strategies",
    "Debug and optimize code"
  ];

  const features = [
    {
      icon: 'fas fa-comments',
      title: 'Natural Conversations',
      description: 'Engage in human-like conversations with advanced context understanding and emotional intelligence.',
      gradient: 'from-blue-500 to-purple-600'
    },
    {
      icon: 'fas fa-code',
      title: 'Code Generation',
      description: 'Generate, debug, and optimize code in 50+ programming languages with intelligent suggestions.',
      gradient: 'from-green-500 to-blue-500'
    },
    {
      icon: 'fas fa-lightbulb',
      title: 'Creative Solutions',
      description: 'Unlock creative potential with AI-powered brainstorming, content creation, and problem-solving.',
      gradient: 'from-purple-500 to-pink-500'
    },
    {
      icon: 'fas fa-shield-alt',
      title: 'Enterprise Security',
      description: 'Bank-level encryption, data privacy compliance, and secure cloud infrastructure for peace of mind.',
      gradient: 'from-orange-500 to-red-500'
    },
    {
      icon: 'fas fa-globe',
      title: 'Multi-Language',
      description: 'Communicate seamlessly in 24+ languages with real-time translation and cultural context awareness.',
      gradient: 'from-teal-500 to-green-500'
    },
    {
      icon: 'fas fa-plug',
      title: 'API Integration',
      description: 'Seamlessly integrate with your existing tools and workflows through our powerful REST API.',
      gradient: 'from-indigo-500 to-purple-500'
    }
  ];

  const testimonials = [
    {
      name: 'Sarah Johnson',
      role: 'Software Engineer',
      initials: 'SJ',
      text: 'NeuralChat AI has revolutionized my coding workflow. The code generation is incredibly accurate and saves me hours every day.',
      gradient: 'from-blue-500 to-purple-600'
    },
    {
      name: 'Michael Chen',
      role: 'Marketing Director',
      initials: 'MC',
      text: 'The creative capabilities are mind-blowing. It helps me generate campaign ideas and content that truly resonates with our audience.',
      gradient: 'from-green-500 to-blue-500'
    },
    {
      name: 'Emily Rodriguez',
      role: 'Research Scientist',
      initials: 'ER',
      text: 'As a researcher, I need accurate and detailed information. NeuralChat AI consistently delivers high-quality insights for my work.',
      gradient: 'from-purple-500 to-pink-500'
    }
  ];

  const stats = [
    { value: 1000000, label: 'Active Users', suffix: 'M+' },
    { value: 50000000, label: 'Messages Processed', suffix: 'M+' },
    { value: 99, label: 'Accuracy Rate', suffix: '%' },
    { value: 24, label: 'Languages Supported', suffix: '' }
  ];

  // Typing animation effect
  useEffect(() => {
    const typeWriter = () => {
      const current = phrases[currentPhrase];

      if (isDeleting) {
        setTypingText(current.substring(0, currentChar - 1));
        setCurrentChar(prev => prev - 1);
      } else {
        setTypingText(current.substring(0, currentChar + 1));
        setCurrentChar(prev => prev + 1);
      }

      let typeSpeed = isDeleting ? 50 : 100;

      if (!isDeleting && currentChar === current.length) {
        typeSpeed = 2000;
        setIsDeleting(true);
      } else if (isDeleting && currentChar === 0) {
        setIsDeleting(false);
        setCurrentPhrase(prev => (prev + 1) % phrases.length);
        typeSpeed = 500;
      }

      setTimeout(typeWriter, typeSpeed);
    };

    const timeout = setTimeout(typeWriter, 100);
    return () => clearTimeout(timeout);
  }, [currentPhrase, currentChar, isDeleting, phrases]);

  // Counter animation
  const animateCounter = (element, target, suffix) => {
    let current = 0;
    const increment = target / 100;

    const timer = setInterval(() => {
      current += increment;
      if (current >= target) {
        current = target;
        clearInterval(timer);
      }

      let displayValue;
      if (target >= 1000000) {
        displayValue = (current / 1000000).toFixed(1) + 'M+';
      } else if (target >= 1000) {
        displayValue = (current / 1000).toFixed(0) + 'K+';
      } else if (suffix === '%') {
        displayValue = Math.floor(current) + '%';
      } else {
        displayValue = Math.floor(current) + suffix;
      }

      if (element) {
        element.textContent = displayValue;
      }
    }, 50);
  };

  // Intersection Observer for animations
  useEffect(() => {
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach(entry => {
          if (entry.isIntersecting) {
            const sectionId = entry.target.getAttribute('data-section');
            setVisibleSections(prev => new Set([...prev, sectionId]));

            // Animate counters for hero section
            if (sectionId === 'hero' && !countersAnimated) {
              setCountersAnimated(true);
              const counters = entry.target.querySelectorAll('.stats-counter');
              counters.forEach((counter, index) => {
                const stat = stats[index];
                animateCounter(counter, stat.value, stat.suffix);
              });
            }
          }
        });
      },
      {
        threshold: 0.1,
        rootMargin: '0px 0px -50px 0px'
      }
    );

    observerRef.current = observer;

    // Observe all sections
    const sections = document.querySelectorAll('[data-section]');
    sections.forEach(section => observer.observe(section));

    return () => observer.disconnect();
  }, [countersAnimated, stats]);

  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  const handleLogin = () => {
    alert('This would redirect to the login/signup page in a real application. The login page we created earlier would be linked here!');
  };

  const handleContactSales = () => {
    alert('This would open a contact form or redirect to a sales page in a real application.');
  };

  return (
    <div className="text-white overflow-x-hidden" style={{
      background: 'linear-gradient(-45deg, #0f0f23, #1a1a2e, #16213e, #0f3460, #533483, #7209b7)',
      backgroundSize: '400% 400%',
      animation: 'gradientShift 20s ease infinite'
    }}>
      <style jsx>{`
        @import url('https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600;700;800;900&display=swap');
        @import url('https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0/css/all.min.css');

        * {
          font-family: 'Inter', sans-serif;
        }

        @keyframes gradientShift {
          0% { background-position: 0% 50%; }
          50% { background-position: 100% 50%; }
          100% { background-position: 0% 50%; }
        }

